    "EdX doesn\\'t have a timed transcript for this video. Please upload an .srt file.": "EdX kh\u00f4ng c\u00f3 b\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho video n\u00e0y. H\u00e3y t\u1ea3i l\u00ean m\u1ed9t t\u1ec7p .srt.",
