    "Enter email addresses and/or usernames, separated by new lines or commas, for the learners you want to add. *": "Nh\u1eadp \u0111\u1ecba ch\u1ec9 email v\u00e0 / ho\u1eb7c t\u00ean ng\u01b0\u1eddi d\u00f9ng, \u0111\u01b0\u1ee3c ph\u00e2n t\u00e1ch b\u1eb1ng d\u00f2ng ho\u1eb7c d\u1ea5u ph\u1ea9y m\u1edbi, cho nh\u1eefng ng\u01b0\u1eddi h\u1ecdc m\u00e0 b\u1ea1n mu\u1ed1n th\u00eam. *",
    "Enter information to describe your team. You cannot change these details after you create the team.": "Nh\u1eadp th\u00f4ng tin \u0111\u1ec3 m\u00f4 t\u1ea3 nh\u00f3m c\u1ee7a b\u1ea1n. B\u1ea1n kh\u00f4ng th\u1ec3 thay \u0111\u1ed5i c\u00e1c chi ti\u1ebft n\u00e0y sau khi b\u1ea1n t\u1ea1o nh\u00f3m.",
    "Enter some details for your support request.": "\u0412\u0432\u0435\u0434\u0456\u0442\u044c \u0434\u0435\u044f\u043a\u0456 \u0434\u0435\u0442\u0430\u043b\u0456 \u0434\u043b\u044f \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0438 \u0432\u0430\u0448\u043e\u0433\u043e \u0437\u0430\u043f\u0438\u0442\u0443.",
