    "Specify an alternative to the official course title to display on certificates. Leave blank to use the official course title.": "Cho m\u1ed9t ti\u00eau \u0111\u1ec1 thay th\u1ebf \u0111\u1ec3 hi\u1ec3n th\u1ecb tr\u00ean gi\u1ea5y ch\u1ee9ng nh\u1eadn. \u0110\u1ec3 tr\u1ed1ng \u0111\u1ec3 s\u1eed d\u1ee5ng ti\u00eau \u0111\u1ec1 ch\u00ednh th\u1ee9c c\u1ee7a kh\u00f3a h\u1ecdc.",
    "Specify any rules or rule exceptions that the proctoring review team should enforce when reviewing the videos. For example, you could specify that calculators are allowed. These specified rules are visible to learners before the learners start the exam, along with the {linkStart}general proctored exam rules{linkEnd}.": "Ch\u1ec9 \u0111\u1ecbnh b\u1ea5t k\u1ef3 quy t\u1eafc ho\u1eb7c c\u00e1c ngo\u1ea1i l\u1ec7 quy t\u1eafc n\u00e0o m\u00e0 nh\u00f3m \u0111\u00e1nh gi\u00e1 gi\u00e1m s\u00e1t c\u1ea7n th\u1ef1c hi\u1ec7n khi xem x\u00e9t video. V\u00ed d\u1ee5, b\u1ea1n c\u00f3 th\u1ec3 ch\u1ec9 \u0111\u1ecbnh \u0111\u01b0\u1ee3c ph\u00e9p s\u1eed d\u1ee5ng m\u00e1y t\u00ednh c\u1ea7m tay. C\u00e1c quy t\u1eafc \u0111\u01b0\u1ee3c ch\u1ec9 \u0111\u1ecbnh n\u00e0y hi\u1ec3n th\u1ecb cho ng\u01b0\u1eddi h\u1ecdc tr\u01b0\u1edbc khi ng\u01b0\u1eddi h\u1ecdc b\u1eaft \u0111\u1ea7u b\u00e0i ki\u1ec3m tra, c\u00f9ng v\u1edbi {linkStart}c\u00e1c quy t\u1eafc thi c\u00f3 gi\u00e1m s\u00e1t chung{linkEnd}.",
    "Specify any rules or rule exceptions that the proctoring review team should enforce when reviewing the videos. For example, you could specify that calculators are allowed. These specified rules are visible to learners before the learners start the exam.": "Ch\u1ec9 \u0111\u1ecbnh b\u1ea5t k\u1ef3 quy t\u1eafc ho\u1eb7c c\u00e1c ngo\u1ea1i l\u1ec7 quy t\u1eafc n\u00e0o m\u00e0 nh\u00f3m \u0111\u00e1nh gi\u00e1 gi\u00e1m s\u00e1t c\u1ea7n th\u1ef1c hi\u1ec7n khi xem x\u00e9t video. V\u00ed d\u1ee5, b\u1ea1n c\u00f3 th\u1ec3 ch\u1ec9 \u0111\u1ecbnh \u0111\u01b0\u1ee3c ph\u00e9p s\u1eed dung m\u00e1y t\u00ednh c\u1ea7m tay. C\u00e1c quy t\u1eafc c\u1ee5 th\u1ec3 n\u00e0y \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb cho ng\u01b0\u1eddi h\u1ecdc tr\u01b0\u1edbc khi ng\u01b0\u1eddi h\u1ecdc b\u1eaft \u0111\u1ea7u b\u00e0i l\u00e0m b\u00e0i ki\u1ec3m thi.",
    "Specify whether content-specific discussion topics are divided.": "Ch\u1ec9 \u0111\u1ecbnh xem c\u00e1c ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn theo n\u1ed9i dung c\u1ee5 th\u1ec3 c\u00f3 \u0111\u01b0\u1ee3c ph\u00e2n chia hay kh\u00f4ng.",
    "Specify whether discussion topics are divided": "Ch\u1ec9 \u0111\u1ecbnh xem c\u00e1c ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn c\u00f3 \u0111\u01b0\u1ee3c ph\u00e2n chia hay kh\u00f4ng",
    "Speed": "\u0428\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c",
    "Spellcheck": "\u041f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0430 \u043f\u0440\u0430\u0432\u043e\u043f\u0438\u0441\u0443",
    "Split cell": "\u0420\u043e\u0437\u0431\u0438\u0442\u0438 \u043a\u043bi\u0442\u0438\u043d\u043a\u0443",
    "Square": "\u041a\u0432\u0430\u0434\u0440\u0430\u0442",
    "Staff": "\u041f\u0435\u0440\u0441\u043e\u043d\u0430\u043b",
    "Staff Only": "\u0422\u0456\u043b\u044c\u043a\u0438 \u0434\u043b\u044f \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u0443",
    "Staff and Learners": "\u041f\u0435\u0440\u0441\u043e\u043d\u0430\u043b \u0442\u0430 \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u0438",
