    "Thumbnail for {videoName}": "\u041c\u0456\u043d\u0456\u0430\u0442\u044e\u0440\u0430 \u0434\u043b\u044f  {videoName}",
    "Thumbnail view of ": "\u041c\u0456\u043d\u0456\u0430\u0442\u044e\u0440\u0430 \u0434\u043b\u044f",
