    "Timed": "C\u00f3 t\u00ednh gi\u1edd",
    "Timed Exam": "B\u00e0i thi Kh\u1ed1ng ch\u1ebf th\u1eddi gian",
    "Timed Transcript Conflict": "Xung \u0111\u1ed9t B\u1ea3n d\u1ecbch \u0110\u00f4ng b\u1ed9 th\u1eddi gian",
    "Timed Transcript Found": "\u0110\u00e3 t\u00ecm th\u1ea5y B\u1ea3n dich \u0110\u1ed3ng b\u1ed9 th\u1eddi gian",
    "Timed Transcript Uploaded Successfully": "\u0110\u00e3 t\u1ea3i l\u00ean B\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian Th\u00e0nh c\u00f4ng",
    "Timed Transcript from %(filename)s": "B\u1ea3n d\u1ecbch \u0110\u1ed3ng b\u1ed9 th\u1eddi gian t\u1eeb %(filename)s",
