    "Title": "\u041d\u0430\u0437\u0432\u0430",
    "Title ": "\u041d\u0430\u0437\u0432\u0430",
    "Title of the signatory": "Ch\u1ee9c danh c\u1ee7a ng\u01b0\u1eddi k\u00fd",
    "Titles more than 100 characters may prevent students from printing their certificate on a single page.": "\u0417\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0438 \u0431\u0456\u043b\u044c\u0448\u0435 100 \u0441\u0438\u043c\u0432\u043e\u043b\u0456\u0432 \u043c\u043e\u0436\u0443\u0442\u044c \u0443\u0441\u043a\u043b\u0430\u0434\u043d\u0438\u0442\u0438 \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u0430\u043c \u0434\u0440\u0443\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0441\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442\u0443 \u043d\u0430 \u043e\u0434\u043d\u0456\u0439 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456.",
    "To access the course, select a session.": "\u0110\u1ec3 truy c\u1eadp kh\u00f3a h\u1ecdc, h\u00e3y ch\u1ecdn m\u1ed9t phi\u00ean.",
    "To be sure all students can access the video, we recommend providing both an .mp4 and a .webm version of your video. Click below to add a URL for another version. These URLs cannot be YouTube URLs. The first listed video that's compatible with the student's computer will play.": "\u0110\u1ec3 ch\u1eafc ch\u1eafn t\u1ea5t c\u1ea3 sinh vi\u00ean c\u00f3 th\u1ec3 truy c\u1eadp v\u00e0o video, ch\u00fang t\u00f4i khuy\u00ean b\u1ea1n n\u00ean cung c\u1ea5p c\u1ea3 phi\u00ean b\u1ea3n .mp4 v\u00e0 .webm video c\u1ee7a b\u1ea1n. B\u1ea5m v\u00e0o b\u00ean d\u01b0\u1edbi \u0111\u1ec3 th\u00eam m\u1ed9t URL cho m\u1ed9t phi\u00ean b\u1ea3n kh\u00e1c. Nh\u1eefng URL n\u00e0y kh\u00f4ng th\u1ec3 l\u00e0 URL tr\u00ean YouTube. Video \u0111\u1ea7u ti\u00ean \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea t\u01b0\u01a1ng th\u00edch v\u1edbi m\u00e1y t\u00ednh c\u1ee7a h\u1ecdc sinh s\u1ebd \u0111\u01b0\u1ee3c ph\u00e1t.",
    "To complete the program, you must earn a verified certificate for each course.": "\u0110\u1ec3 ho\u00e0n th\u00e0nh ch\u01b0\u01a1ng tr\u00ecnh, b\u1ea1n ph\u1ea3i ki\u1ebfm \u0111\u01b0\u1ee3c ch\u1ee9ng ch\u1ec9 \u0111\u00e3 \u0111\u01b0\u1ee3c x\u00e1c minh cho m\u1ed7i kh\u00f3a h\u1ecdc.",
    "To continue learning with this account, sign in below.": "\u0110\u1ec3 ti\u1ebfp t\u1ee5c h\u1ecdc v\u1edbi t\u00e0i kho\u1ea3n n\u00e0y, h\u00e3y \u0111\u0103ng nh\u1eadp b\u00ean d\u01b0\u1edbi.",
    "To invalidate a certificate for a particular learner, add the username or email address below.": "\u0429\u043e\u0431 \u0430\u043d\u0443\u043b\u044e\u0432\u0430\u0442\u0438 \u0441\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442 \u0434\u043b\u044f \u043f\u0435\u0432\u043d\u043e\u0433\u043e \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430, \u0434\u043e\u0434\u0430\u0439\u0442\u0435 \u0456\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0430\u0431\u043e \u0430\u0434\u0440\u0435\u0441\u0443 \u043f\u043e\u0448\u0442\u043e\u0432\u043e\u0457 \u0441\u043a\u0440\u0438\u043d\u044c\u043a\u0438. ",
    "To receive a certificate, you must also verify your identity before {date}.": "\u0110\u1ec3 nh\u1eadn \u0111\u01b0\u1ee3c ch\u1ee9ng ch\u1ec9, b\u1ea1n c\u0169ng ph\u1ea3i x\u00e1c minh danh t\u00ednh c\u1ee7a m\u00ecnh tr\u01b0\u1edbc {date}.",
    "To receive a certificate, you must also verify your identity.": "\u0110\u1ec3 nh\u1eadn \u0111\u01b0\u1ee3c ch\u1ee9ng ch\u1ec9, b\u1ea1n c\u0169ng ph\u1ea3i x\u00e1c minh danh t\u00ednh c\u1ee7a m\u00ecnh.",
    "To receive credit for problems, you must select \"Submit\" for each problem before you select \"End My Exam\".": "\u0110\u1ec3 nh\u1eadn \u0111\u01b0\u1ee3c t\u00edn ch\u1ec9 cho c\u00e1c v\u1ea5n \u0111\u1ec1, b\u1ea1n ph\u1ea3i ch\u1ecdn \"G\u1eedi\" cho t\u1eebng v\u1ea5n \u0111\u1ec1 tr\u01b0\u1edbc khi b\u1ea1n ch\u1ecdn \"K\u1ebft th\u00fac B\u00e0i ki\u1ec3m tra c\u1ee7a t\u00f4i\".",
