    "Warnings": "\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u0436\u0435\u043d\u043d\u044f",
    "We ask you to activate your account to ensure it is really you creating the account and to prevent fraud.": "Ch\u00fang t\u00f4i y\u00eau c\u1ea7u b\u1ea1n k\u00edch ho\u1ea1t t\u00e0i kho\u1ea3n c\u1ee7a m\u00ecnh \u0111\u1ec3 \u0111\u1ea3m b\u1ea3o r\u1eb1ng ch\u00ednh b\u1ea1n th\u1ef1c s\u1ef1 l\u00e0 ng\u01b0\u1eddi t\u1ea1o t\u00e0i kho\u1ea3n v\u00e0 \u0111\u1ec3 ng\u0103n ch\u1eb7n gian l\u1eadn.",
