    "We couldn't find any results for \"%s\".": "\u041c\u0438 \u043d\u0435 \u0437\u043c\u043e\u0433\u043b\u0438 \u0437\u043d\u0430\u0439\u0442\u0438 \u0436\u043e\u0434\u043d\u0438\u0445 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0456\u0432 \u0434\u043b\u044f \"%s\".",
    "We couldn't sign you in.": "\u041d\u0435\u043c\u043e\u0436\u043b\u0438\u0432\u043e \u0443\u0432\u0456\u0439\u0442\u0438.",
    "We have encountered an error. Refresh your browser and then try again.": "\u041c\u0438 \u043f\u043e\u043c\u0456\u0442\u0438\u043b\u0438 \u043f\u043e\u043c\u0438\u043b\u043a\u0443. \u041e\u043d\u043e\u0432\u0456\u0442\u044c \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 \u0432 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0456, \u0430 \u043f\u043e\u0442\u0456\u043c \u043f\u043e\u0432\u0442\u043e\u0440\u0456\u0442\u044c \u0441\u043f\u0440\u043e\u0431\u0443.",
    "We have received your information and are verifying your identity. You will see a message on your dashboard when the verification process is complete (usually within 5-7 days). In the meantime, you can still access all available course content.": "Ch\u00fang t\u00f4i \u0111\u00e3 nh\u1eadn \u0111\u01b0\u1ee3c th\u00f4ng tin c\u1ee7a b\u1ea1n v\u00e0 \u0111ang x\u00e1c minh danh t\u00ednh c\u1ee7a b\u1ea1n. B\u1ea1n s\u1ebd th\u1ea5y th\u00f4ng b\u00e1o tr\u00ean trang t\u1ed5ng quan c\u1ee7a m\u00ecnh khi qu\u00e1 tr\u00ecnh x\u00e1c minh ho\u00e0n t\u1ea5t (th\u01b0\u1eddng trong v\u00f2ng 5-7 ng\u00e0y). Trong th\u1eddi gian ch\u1edd \u0111\u1ee3i, b\u1ea1n v\u1eabn c\u00f3 th\u1ec3 truy c\u1eadp t\u1ea5t c\u1ea3 n\u1ed9i dung kh\u00f3a h\u1ecdc c\u00f3 s\u1eb5n.",
    "We just need a little more information before you start learning with %(platformName)s.": "\u041d\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0449\u0435 \u0442\u0440\u043e\u0445\u0438 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u043f\u0435\u0440\u0435\u0434 \u0442\u0438\u043c, \u044f\u043a \u0432\u0438 \u043f\u043e\u0447\u043d\u0435\u0442\u0435 \u043d\u0430\u0432\u0447\u0430\u043d\u043d\u044f \u043d\u0430 %(platformName)s.",
    "We securely encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Ch\u00fang t\u00f4i m\u00e3 h\u00f3a \u1ea3nh c\u1ee7a b\u1ea1n m\u1ed9t c\u00e1ch an to\u00e0n v\u00e0 g\u1eedi \u1ea3nh \u0111\u1ebfn d\u1ecbch v\u1ee5 \u1ee7y quy\u1ec1n c\u1ee7a ch\u00fang t\u00f4i \u0111\u1ec3 xem x\u00e9t. \u1ea2nh v\u00e0 th\u00f4ng tin c\u1ee7a b\u1ea1n kh\u00f4ng \u0111\u01b0\u1ee3c l\u01b0u ho\u1eb7c hi\u1ec3n th\u1ecb \u1edf b\u1ea5t k\u1ef3 \u0111\u00e2u tr\u00ean %(platformName)s sau khi qu\u00e1 tr\u00ecnh x\u00e1c minh ho\u00e0n t\u1ea5t.",
    "We use the highest levels of security available to encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Ch\u00fang t\u00f4i s\u1eed d\u1ee5ng c\u00e1c m\u1ee9c b\u1ea3o m\u1eadt cao nh\u1ea5t c\u00f3 s\u1eb5n \u0111\u1ec3 m\u00e3 h\u00f3a h\u00ecnh \u1ea3nh c\u1ee7a b\u1ea1n v\u00e0 g\u1eedi n\u00f3 \u0111\u1ebfn d\u1ecbch v\u1ee5 \u1ee7y quy\u1ec1n c\u1ee7a ch\u00fang t\u00f4i \u0111\u1ec3 xem x\u00e9t. \u1ea2nh v\u00e0 th\u00f4ng tin c\u1ee7a b\u1ea1n s\u1ebd kh\u00f4ng \u0111\u01b0\u1ee3c l\u01b0u hay b\u1ea5t c\u1ee9 n\u01a1i n\u00e0o c\u00f3 th\u1ec3 nh\u00ecn th\u1ea5y tr\u00ean %(platformName)s sau khi qu\u00e1 tr\u00ecnh x\u00e1c minh ho\u00e0n t\u1ea5t.",
    "We use your verification photos to confirm your identity and ensure the validity of your certificate.": "Ch\u00fang t\u00f4i s\u1eed d\u1ee5ng \u1ea3nh x\u00e1c minh c\u1ee7a b\u1ea1n \u0111\u1ec3 x\u00e1c nh\u1eadn danh t\u00ednh c\u1ee7a b\u1ea1n v\u00e0 \u0111\u1ea3m b\u1ea3o t\u00ednh h\u1ee3p l\u1ec7 c\u1ee7a ch\u1ee9ng ch\u1ec9 c\u1ee7a b\u1ea1n.",
    "We're sorry to see you go! Your account will be deleted shortly.": "\u041d\u0430\u043c \u0448\u043a\u043e\u0434\u0430, \u0449\u043e \u0432\u0438 \u0439\u0434\u0435\u0442\u0435! \u0412\u0430\u0448 \u0430\u043a\u0430\u0443\u043d\u0442 \u0431\u0443\u0434\u0435 \u0432\u0438\u0434\u0430\u043b\u0435\u043d\u043e \u043d\u0430\u0439\u0431\u043b\u0438\u0436\u0447\u0438\u043c \u0447\u0430\u0441\u043e\u043c.",
